public class Chapter1302
{

    CallInt callInt;

    interface CallInt
    {
        int call(int n);
    }

    Chapter1302()
    {
        callInt = n -> n == 0 ? 0 :
                       n == 1 ? 1 :
                       callInt.call(n - 1 ) + callInt.call(n - 2);
    }



    public static void main(String[] args)
    {
        Chapter1302 chapter1302 = new Chapter1302();
        for (int i = 0; i < 10; i++)
        {
            System.out.println(chapter1302.callInt.call(i));
        }
        String s = "{\"11111111111111111111111111111111111111111111111111111111111111111111111111111111111\": \"\"}";
        System.out.println(s.length());
    }

}
